import React from "react";
import NavBar from "./navbar/NavBar";
import { BrowserRouter, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <NavBar />
        <Route exact path="/" component={Home} />
        <Route path="/" component={Demographics} />
        <Route path="/" component={DeepDive} />
      </BrowserRouter>
    </div>
  );
}

export default App;
